type Item = {
  id: number
  name: string
  rating: number
  type: 'Music' | 'Social' | 'Photo & video' | 'Productivity' | 'Gaming' | 'Movies'
  image: string
  isFree: boolean | number
}
type ItemDetailed = {
  organization: string
  imageSecondary: string
  details: string
  detailedType: string
  screenShots: string[]
}

type completeItem = Item & ItemDetailed

type NamedItemGroup = {
  namedItem: string
  items: Item[]
}

type NamedItemDetailedGroup = {
  namedItem: string
  items: completeItem[]
}

type JsonArray = NamedItemGroup[]

type StoreItemData = NamedItemDetailedGroup[]

